['드래곤들은 각각의 특성에 따라 {@RED}공격{@DEFAULT}, {@BLUE}방어{@DEFAULT}, {@grass_green}회복{@DEFAULT}, {@purple}지원{@DEFAULT} 중 하나의 직군을 가집니다.\n\n- {@RED}공격{@DEFAULT}: 몬스터들을 공격하는 것에 특화된 드래곤입니다.\n- {@BLUE}방어{@DEFAULT}: 아군 드래곤들 앞에서 몬스터의 공격을 방어하며 지켜주는 드래곤입니다.\n- {@grass_green}회복{@DEFAULT}: 충격을 입은 드래곤들의 HP를 회복하는 등 파티의 생존력을 높여주는 드래곤입니다.\n- {@purple}지원{@DEFAULT}: 아군 드래곤의 공격을 강화하거나, 몬스터의 공격을 방해하는 등 파티를 지원하는 드래곤입니다.']='Visi drakonai turi vieną profesiją iš šių: {@RED} Attack{@DEFAULT}, {@BLUE} Defense{@DEFAULT}, {@grass_green} Recover{@DEFAULT} arba {@purple} Support{@DEFAULT}. \n\n– {@RED} Ataka{@DEFAULT}: specializuojasi puolant monstrus. \n– {@BLUE} gynyba{@DEFAULT}: apsaugo kitus drakonus priekyje. \n– {@grass_green} Atkurti{@DEFAULT}: specializuojasi gerinant kitų drakonų išgyvenamumą atkuriant pažeistų drakonų AG. \n– {@purple} Palaikymas{@DEFAULT}: specializuojasi teikiant teigiamą poveikį sąjungininkams arba žalingą poveikį priešams.',
