['드래곤의 진화에 사용되는 각종 진화 재료를 얻을 수 있는 던전입니다.\n거대용들의 특성을 파악하고 속성을 공략해, 여러분의 드래곤을 진화시켜보세요.\n\n<보스 정보>\n- {@YELLOW}보석 거대용{@DEFAULT}: 보석 거대용은 생명력이 매우 높지만, 난이도 자체는 평범합니다.\n- {@grass_green}땅의 거대용{@DEFAULT}: 물속성 드래곤에게 큰 피해를 줍니다.\n- {@BLUE}물의 거대용{@DEFAULT}: 불속성 드래곤에게 큰 피해를 줍니다.\n- {@RED}불의 거대용{@DEFAULT}: 땅속성 드래곤에게 큰 피해를 줍니다.\n- {@YELLOW}빛의 거대용{@DEFAULT}: 어둠속성 드래곤에게 큰 피해를 줍니다.\n- {@GRAY}어둠의 거대용{@DEFAULT}: 빛속성 드래곤에게 큰 피해를 줍니다.']='Tai požemis, kuriame galite įsigyti įvairių Evoliucija medžiagų, reikalingų evoliucijai.\nIšsiaiškinkite didžiųjų drakonų savybes ir naudokite jų atributus prieš juos, kad evoliucionuotų savo drakonus. \n\n<Boss Info> \n– {@YELLOW} Masyvus brangakmenis drakonas{@DEFAULT}: Masyvus brangakmenis drakonas turi labai aukštą AG, bet jį nesunku nužudyti. \n– {@grass_green} Masyvus Žemė drakonas{@DEFAULT}: daro didelę žalą Vanduo drakonams. \n– {@BLUE} Masyvus Vandens drakonas{@DEFAULT}: Ugnis drakonams daro didelę žalą. \n– {@RED} Masyvus Ugnies drakonas{@DEFAULT}: Žemės drakonams daro Žemė žalą. \n– {@YELLOW} Masyvus Šviesa drakonas{@DEFAULT}: Tamsus Dragons daro didelę žalą. \n– {@GRAY} Masyvus Tamsus drakonas{@DEFAULT}: daro didelę žalą Šviesa drakonams.',
['드래곤의 최대레벨이 10 증가하였습니다!']='Dragon\'s Max lygis padidėjo 10!',
['드래곤의 힘을 더 강하게 할 수 있는 룬을 얻을 수 \n 있는 곳으로, 악몽 던전에서만 발견되는 룬도 있다고 합니다.']='Norite padaryti savo drakoną dar stipresnį?\nSakoma, kad kai kurias runas\ngalima rasti tik Nightmare Dungeon.',
['드래곤이 가득 찼습니다.\n인벤토리 공간을 확보 후 전투를 시작할 수 있습니다.']='Drakonai yra pilni.\nGalite pradėti mūšį, kai tik turėsite vietos.',
['드래곤이 가진 스킬은 레벨이 높을 수록 스킬 능력이 강화되어 전투를 더 유리하게 진행할 수 있습니다.\n스킬의 레벨을 상승시키려면 {@YELLOW}같은 이름의 드래곤{@DEFAULT} 혹은 {@YELLOW}스킬 슬라임{@DEFAULT}이 필요하며, 최고 레벨이 아닌 보유 스킬 중 하나가 무작위로 레벨이 상승합니다.']='Drakonų įgūdžiai stiprėja, o mūšis jums tampa palankesnis, kai jo lygis didėja.\nJei norite padidinti drakono įgūdžių lygį, jums reikia {@YELLOW} to paties drakono{@DEFAULT} arba {@YELLOW} Skill Slime{@DEFAULT} . Tada padidinamas atsitiktinių įgūdžių, kurie nepasiekė maksimalaus lygio, lygis.',
['드래곤이 가진 스킬의 종류에 따라 {@YELLOW}조건부로 발동{@DEFAULT}하는 자동 스킬입니다.\n발동 조건은 드래곤의 스킬에 따라 각각 다르며, 드래곤 관리 화면에서 확인하실 수 있습니다.']='Automatinis įgūdis {@YELLOW} suaktyvintas sąlyginai{@DEFAULT}, atsižvelgiant į tai, kokius įgūdžius turi jūsų drakonas.\nAktyvinimo būsena skiriasi nuo drakonų įgūdžių ir ją galima patikrinti drakonas valdymo skirtuke.',
['드래곤이 강한 정도를 나타내는 보조적인 정보입니다.\n전투력이 낮더라도 파티의 조합과 스킬의 활용에 따라 충분히 극복 가능합니다.']='Papildoma informacija, rodanti, koks stiprus yra drakonas.\nNors jis silpnas, jį galima įveikti sudarant partiją ir naudojant įgūdžius.',
['드래곤이 얼마나 희귀한지를 나타내는 정보입니다.\n드래곤이 희귀할수록 더 강하고 좋은 스킬을 가지고 있으며, 드래곤이 희귀할수록 드래곤의 최초 등급이 더 높습니다.\n\n- 일반 희귀도: 1~2등급 상태로 획득\n- {@BLUE}희귀 희귀도{@DEFAULT}: 3등급 상태로 획득\n- {@purple}영웅 희귀도{@DEFAULT}: 4등급 상태로 획득\n- {@YELLOW}전설 희귀도{@DEFAULT}: 5등급 상태로 획득']='Ši informacija parodo, koks retas yra drakonas.\nRetesni drakonai turi stipresnius ir geresnius įgūdžius, taip pat aukštesnį pradinį įvertinimą. \n\n– Normalus: gauti kaip 1–2 klasę \n– {@BLUE} Retas{@DEFAULT}: gauti kaip 3 klasę \n– {@purple} Didvyriškas{@DEFAULT}: gauti kaip 4 klasę \n- {@YELLOW} Legendinis{@DEFAULT}: gaukite 5 klasę',
['드래곤이 없습니다.']='Drakonų inventoriuje nėra.',
['드래곤이 좋아하는 열매를 얻을 수 있는 던전으로, 열매를 얻어 드래곤의 친밀도를 높일 수 있습니다.\n\n<보스 정보>\n- {@grass_green}땅의 거목{@DEFAULT}: 물속성 드래곤에게 큰 피해를 줍니다.\n- {@BLUE}물의 거목{@DEFAULT}: 불속성 드래곤에게 큰 피해를 줍니다.\n- {@RED}불의 거목{@DEFAULT}: 땅속성 드래곤에게 큰 피해를 줍니다.\n- {@YELLOW}빛의 거목{@DEFAULT}: 어둠속성 드래곤에게 큰 피해를 줍니다.\n- {@GRAY}어둠의 거목{@DEFAULT}: 빛속성 드래곤에게 큰 피해를 줍니다.']='Tai požemis, kuriame galite gauti įvairių vaisių, kuriuos mėgsta jūsų drakonai, o šiais vaisiais galite padidinti artumą. \n\n<Boss Info> \n– {@grass_green} Masyvus Žemė medis{@DEFAULT}: Padarykite didelę žalą Vanduo drakonams. \n– {@BLUE} Masyvus Vanduo medis{@DEFAULT}: Padarykite didelę žalą Ugnis drakonams. \n– {@RED} Masyvi Ugnis medis{@DEFAULT}: Padarykite didelę žalą Žemė drakonams. \n– {@YELLOW} Masyvus Šviesa medis{@DEFAULT}: Tamsus Dragons padaryk didelę žalą. \n– {@GRAY} Masyvus Tamsus medis{@DEFAULT}: Padarykite didelę žalą Šviesa drakonams.',
['드래곤이 희귀할수록 처음 획득했을 때의 등급이 높아집니다.\n다만 낮은 등급의 드래곤도 계속 키워나가면 6등급까지 성장시킬 수 있으니, 맘에 드는 드래곤을 마지막까지 함께 하실 수 있습니다.']='Kuo retesnis drakonas, tuo aukštesnis jo pradinis įvertinimas.\nTačiau žemesnio pradinio laipsnio drakonai gali būti auginami iki 6 klasės, kad galėtumėte išlaikyti patinkantį drakoną iki galo.',
