['드래곤과 몬스터들은 스킬을 통해서 아군을 강하게 하는 효과를 부여할 수 있습니다.\n\n- {@green}공격력 증가{@DEFAULT} : 공격력이 20% 증가됩니다. (최대 3회까지 중첩 가능)\n- {@green}방어력 증가 {@DEFAULT}: 방어력이 20% 증가됩니다. (최대 3회까지 중첩 가능)\n- {@green}공격속도 증가{@DEFAULT} : 공격속도가 20% 증가됩니다. (최대 3회까지 중첩 가능)\n- {@green}치명확률 증가{@DEFAULT} : 치명확률이 30% 증가됩니다.\n- {@green}치명회피 증가{@DEFAULT} : 치명회피가 30% 증가됩니다.\n- {@green}회피 증가{@DEFAULT} : 회피가 30% 증가됩니다.\n- {@green}적중 증가{@DEFAULT} : 적중이 30% 증가됩니다.\n- {@green}무적{@DEFAULT} : 모든 피해를 받지 않습니다. 해로운 효과에는 걸릴 수 있습니다.\n- {@green}좀비{@DEFAULT} : 생명력이 0이 될 때 발동하며 죽지 않는 상태가 됩니다. 지속시간이 끝나면 바로 사망합니다.\n스킬에 따라 공격속도 300% 증가 혹은 치명확률 50% 증가의 비약적 증가 효과를 함께 얻습니다.\n- {@green}보호막{@DEFAULT} : 보호막이 가지고 있는 생명력 만큼의 피해를 방어합니다.\n- {@green}반사{@DEFAULT} : 적으로부터 받는 피해의 80%만 받으며 나머지 20%의 피해를 공격자에게 되돌립니다.\n- {@green}면역{@DEFAULT} : 모든 해로운 효과에 걸리지 않습니다. 이미 걸린 해로운 효과는 해제되지 않습니다.\n- {@green}흡혈{@DEFAULT} : 적에게 피해를 입혔을 때 피해량의 10%를 자신의 생명력으로 회복합니다.']='Drakonai ir monstrai gali suteikti naudingų padarinių sąjungininkams. \n\n– {@green} Padidinti ATK{@DEFAULT}: ATK padidinama 20 %. (Galima sukrauti iki 3 kartų) \n- {@green} Padidinti DEF {@DEFAULT}: DEF padidinamas 20%. (Galima sudėti iki 3 kartų) \n– {@green} Padidinti ATK greitį {@DEFAULT}: ATK greitis padidėjo 20 %. (Galima sudėti iki 3 kartų) \n– {@green} Padidinti kritinį rodiklį{@DEFAULT}: kritinis rodiklis padidėjo 30 proc. \n– {@green} Padidinti kritinį vengimą{@DEFAULT}: kritinis vengimas padidinamas 30 proc. \n– {@green} Padidinti vengimą{@DEFAULT}: vengimas padidėja 30 proc. \n– {@green} Padidinti ACC{@DEFAULT}: ACC padidinama 30 %. \n– {@green} Nepažeidžiamas{@DEFAULT}: atsparus visoms atakoms, bet vis tiek veikiamas žalingo poveikio. \n– {@green} Zombie{@DEFAULT}: suaktyvinamas, kai HP pasiekia 0. drakonas nemirs, kol nesibaigs trukmė.\nPasiekite vieną iš šių dramatiškų efektų, 300 % padidinkite ATK greitį arba 50 % padidinkite kritinį Įvertinkite pagal įgūdžius. \n– {@green} Barjeras{@DEFAULT}: atsparus žalai, lygiai užtvaros HP. \n– {@green} Atspindėti{@DEFAULT}: gaukite tik 80% žalos iš priešo ir 20% grąžinkite užpuolikui. \n– {@green} Imunitetas{@DEFAULT}: atsparus bet kokiam žalingam poveikiui. Dabartinis žalingas poveikis nepašalinamas. \n– {@green} HP absorbcija{@DEFAULT}: atgausite 10 % žalos, padarytos priešui kaip HP.',
['드래곤과 몬스터들은 스킬을 통해서 적을 약하게 하는 효과를 부여할 수 있습니다.\n\n- {@YELLOW}공격력 감소{@DEFAULT} : 공격력이 20% 감소됩니다. (최대 3회까지 중첩 가능)\n- {@YELLOW}방어력 감소{@DEFAULT} : 방어력이 20% 감소됩니다. (최대 3회까지 중첩 가능)\n- {@YELLOW}공격속도 감소{@DEFAULT} : 공격속도가 20% 감소됩니다. (최대 3회까지 중첩 가능)\n- {@YELLOW}치명확률 감소{@DEFAULT} : 치명확률이 30% 감소됩니다.\n- {@YELLOW}치명피해 감소{@DEFAULT} : 치명피해가 50% 감소됩니다.\n- {@YELLOW}치명회피 감소{@DEFAULT} : 치명회피가 30% 감소됩니다.\n- {@YELLOW}회피 감소{@DEFAULT} : 회피가 30% 감소됩니다.\n- {@YELLOW}적중 감소{@DEFAULT} : 적중이 30% 감소됩니다.\n- {@YELLOW}회복량 감소{@DEFAULT} : 회복을 받았을 때 회복량이 70% 감소됩니다.\n- {@YELLOW}기절{@DEFAULT} : 모든 일반공격과 스킬을 사용할 수 없습니다.\n- {@YELLOW}수면{@DEFAULT} : 모든 일반공격과 스킬을 사용할 수 없습니다. 공격을 받았을 때 해제됩니다.\n- {@YELLOW}침묵{@DEFAULT} : 모든 스킬을 사용할 수 없습니다.\n- {@YELLOW}지속피해{@DEFAULT} : 일정 시간마다 최대 생명력의 0.5%의 피해를 받습니다. (최대 3회까지 중첩 가능)']='Drakonai ir monstrai gali sukelti žalingą poveikį priešams. \n\n– {@YELLOW} Sumažinti ATK{@DEFAULT}: ATK sumažinama 20 %. (Galima sukrauti iki 3 kartų) \n– {@YELLOW} Sumažinti DEF {@DEFAULT}: DEF sumažinama 20 %. (Galima sudėti iki 3 kartų) \n– {@YELLOW} Sumažinti ATK greitį {@DEFAULT}: ATK greitis sumažinamas 20 %. (Galima sudėti iki 3 kartų) \n– {@YELLOW} Sumažinti kritinį rodiklį{@DEFAULT}: kritinis rodiklis sumažintas 30 %. \n– {@YELLOW} Sumažinti kritinį DMG{@DEFAULT}: kritinis DMG sumažinamas 50 %. \n– {@YELLOW} Sumažinti kritinį vengimą{@DEFAULT}: kritinis vengimas sumažėja 30 %. \n– {@YELLOW} Sumažinti vengimą{@DEFAULT}: vengimas sumažėja 30 %. \n– {@YELLOW} Sumažinti ACC{@DEFAULT}: ACC sumažinama 30 %. \n– {@YELLOW} Sumažinti atkūrimo rodiklį{@DEFAULT}: atkūrimo suma sumažinama 70 %. \n– {@YELLOW} Stulbinantis{@DEFAULT}: negali pulti ar naudoti įgūdžių. \n– {@YELLOW} Miego režimas{@DEFAULT}: negali panaudoti visų įgūdžių ir negali pulti. Būsena pašalinta užpuolus. \n– {@YELLOW} Tyla{@DEFAULT}: negali panaudoti visų įgūdžių. \n– {@YELLOW} TAŠKO žala{@DEFAULT}: kiekvieną nustatytą kartą gaukite 0,5 % maks. HP žalą. (Galima sukrauti iki 3 kartų)',
