['먼 옛날부터 테이머들이 자신을 시험하기 위해 올라갔다고 하는 전설의 탑으로, 탑을 정복한 자에게는 많은 보물이 주어진다고 전해집니다.\n고대의 탑과 관련해서는 다음의 내용을 잊지 마세요\n\n- 고대의 탑은 {@YELLOW}1층부터 차례대로{@DEFAULT} 올라갈 수 있으며, 매 층 클리어 시 다양한 보상을 제공합니다.\n- 이미 클리어한 층도 다시 플레이할 수 있으나, {@YELLOW}매우 소량의 보상{@DEFAULT}만 제공됩니다.\n- 같은 층을 반복해서 실패할 경우 많은 공격을 받은 {@YELLOW}고대의 탑의 몬스터들이 약해진다{@DEFAULT}고 합니다.\n- 고대의 탑 클리어 시 {@YELLOW}클리어 시간, 드래곤의 사망 여부, 약화 효과 단계{@DEFAULT}에 따라 클리어 점수를 받게 됩니다.\n- 고대의 탑 점수로 고대의 탑을 즐긴 다른 테이머 분들과의 순위가 책정되며, 이곳에서만 얻을 수 있는 희귀한 재화인 {@YELLOW}고대주화{@DEFAULT}를 포함한 많은 보상을 얻을 수 있습니다.\n  고대주화는 상점에서 {@YELLOW}매우 희귀한 드래곤의 인연 포인트{@DEFAULT}와 교환할 수 있습니다.\n- 고대의 탑의 점수 및 클리어 정보는 2주마다 한 번씩 초기화됩니다.\n\n고대의 탑의 클랜 순위는 성적 상위 20명의 점수만 반영됩니다.(보상은 클랜원 전체가 획득)']='Legendinis bokštas, į kurį Tamers seniai kopė norėdami išbandyti save. Sakoma, kad bokštą užkariavusieji apdovanojami dideliu lobiu.\nNepamirškite toliau pateikto turinio apie Senovinį bokštą. \n\n– Į senovinį bokštą galima užkopti nuo {@YELLOW} 1F{@DEFAULT}, o už kiekvieno lygio išvalymą suteikiami įvairūs apdovanojimai. \n– Galite vėl žaisti išvalytus lygius, bet bus suteiktas {@YELLOW} labai mažas atlygis{@DEFAULT}. \n– Sakoma, kad jei jums nepavyks to paties lygio kelis kartus, {@YELLOW} monstrai Senoviniame bokšte susilpnės{@DEFAULT}. \n– Valydami Senovinį bokštą gausite aiškų balą pagal {@YELLOW} grynąjį laiką, drakonų išgyvenimą ir susilpnintą efekto lygį{@DEFAULT}. \n– Jūs esate reitinguojami kartu su kitais tramdytojais, kurie žaidė Senovinį bokštą pagal jūsų Senovinio bokšto balą. Galite gauti daug apdovanojimų, įskaitant retą žaidimo valiutą, vadinamą {@YELLOW} senovinėmis monetomis{@DEFAULT}. \nSenovines monetas parduotuvėje galima iškeisti į {@YELLOW} labai retus drakono santykių taškus{@DEFAULT}. \n– Senovės bokšto balas ir aiški informacija atnaujinami kas 2 savaites. \n\nSenovės bokšto klano reitinge atsižvelgiama tik į 20 geriausių taškų. (Visi klano nariai gauna apdovanojimus.)',
