['드래곤 빌리지M의 무대가 되는 유타칸 세계에서 벌어지는 {@YELLOW}이야기{@DEFAULT}를 따라가며\n테이머와 드래곤을 {@YELLOW}성장{@DEFAULT}시킬 수 있습니다.']='Sekite {@YELLOW} istoriją{@DEFAULT} apie Jutakanas, Dragon Village M pasaulį,\nir {@YELLOW} aukštyn{@DEFAULT} savo tramdytojų ir drakonų.',
['모험 도중 우연히 만난 드래곤의 기억속에서 {@YELLOW}인연 포인트{@DEFAULT}를 얻을 수 있습니다.\n\n드래곤의 인연 포인트가 쌓이면 부화소에서 함께 할 수 있는 동료로 소환 할 수 있습니다.\n테이머님의 친구가 발견한 인연 던전에도 들어갈 수 있습니다.']='Uždirbkite {@YELLOW} santykių taškų{@DEFAULT} iš prisiminimų apie drakonus, sutiktus nuotykių metu. \n\nSu santykių taškais galite sukviesti draugus į Peryklą (Summon). \nTaip pat galite patekti į „Relationship Dungeons“, kuriuos rado jūsų draugai.',
['보유한 드래곤을 유타칸의 다양한 지역으로 {@YELLOW}탐험{@DEFAULT}을 보내 {@YELLOW}성장{@DEFAULT}시킬 수 있습니다.\n\n탐험을 보내기 위해서는 5마리의 드래곤이 필요하며, 탐험에서 발견한 룬과 자수정을 가지고 돌아옵니다.']='Nusiųskite savo drakonus {@YELLOW} tyrinėti{@DEFAULT} kitas Jutakanas sritis ir {@YELLOW} aukštyn{@DEFAULT}. \n\nJums reikia mažiausiai penkių drakonų, kad galėtumėte išsiųsti tyrinėti. Grįžę jie sugrąžina rastas runas ir ametistus.',
['하루에 한번 {@YELLOW}저렴한 가격{@DEFAULT}으로 상품을 구매할 수 있습니다.\n\n고급소환권과 골드, 모험에서 사용가능한 경험치와 골드 부스터 상품을 판매하고 있습니다.']='Kartą per dieną galite įsigyti prekių už {@YELLOW} mažesnę kainą{@DEFAULT}. \n\nGalite įsigyti išplėstinius šaukimo bilietus, Auksas, Auksas stiprintuvus ir EXP, kuriuos galite naudoti savo nuotykių metu.',
['오랜 시간 유타칸 세계의 신비한 힘을 흡수해 살아 움직이게 된 {@YELLOW}거목{@DEFAULT}이 등장합니다.\n\n거목을 물리치면 드래곤의 친밀도를 올리는 {@YELLOW}열매{@DEFAULT}를 얻을 수 있습니다.\n\n요일에 따라 들어갈 수 있는 던전의 속성이 변화합니다.']='Yra {@YELLOW} masyvūs medžiai{@DEFAULT}, kurie atgijo po to, kai sugėrė paslaptingą Jutakanas galią. \n\nKai įveiksite tuos medžius, galite gauti įvairių {@YELLOW} vaisių{@DEFAULT} ir padidinti savo artumą su drakonais. \n\nPožemio atributai, kuriuos galite įvesti, keičiasi kiekvienai savaitės dienai.',
['태초의 드래곤의 힘이 담긴 진화의 보석과 자연의 정기를 지키고 있는 거대용들의 서식지입니다.\n\n거대용들을 물리치면 {@YELLOW}드래곤을 진화{@DEFAULT}시킬 수 있는 {@YELLOW}보석과 정기{@DEFAULT}를 얻을 수 있습니다.\n진화한 드래곤은 모습이 변화하며 새로운 스킬을 얻어 더욱 강해집니다.\n\n요일에 따라 들어갈 수 있는 던전의 속성이 변화합니다.']='Tai masyvių drakonų buveinė, sauganti Evoliucija brangakmenį ir energiją, kurioje yra drakonų galia. \n\nKai nugalite Massive Dragons, gausite {@YELLOW} Evoliucija brangakmenį ir energiją{@DEFAULT}, kurios suaktyvina {@YELLOW} drakonų Evoliucija {@DEFAULT}.\nKai drakonas išsivysto, jis pakeičia savo išvaizdą ir tampa galingesnis su naujais įgūdžiais. \n\nPožemio atributai, kuriuos galite įvesti, keičiasi kiekvienai savaitės dienai.',
['먼 옛날부터 테이머들이 자신을 시험하기 위해 올라갔다고 하는 전설의 탑입니다.\n\n더 높은 층으로 올라갈 수록 더욱 강력한 드래곤들을 물리쳐야만 합니다.\n매 층 클리어 시 다양한 보상을 얻을 수 있으며, {@YELLOW}층별 점수에 따라 순위가 결정{@DEFAULT}됩니다.\n\n고대의 탑은 2주마다 시즌이 종료되며 순위에 따라 {@YELLOW}고대주화{@DEFAULT}를 얻을 수 있습니다.']='Legendinis bokštas, į kurį Tamers seniai kopė norėdami išbandyti save. \n\nPakildami į viršų kovojate su galingesniais drakonais.\nIšvalę kiekvieną aukštą gaunate įvairių apdovanojimų ir esate {@YELLOW} reitinge, atsižvelgiant į taškus, kuriuos surinkote už kiekvieną aukštą{@DEFAULT}. \n\nKiekvienas Senovinio bokšto sezonas trunka 2 savaites, o pagal savo reitingą galite gauti {@YELLOW} senovinių monetų{@DEFAULT}.',
['마녀 나르비는 자신의 연구에 필요한 고대 주화를 수집하기 위해 상점을 열었습니다.\n고대의 탑에서 얻은 고대 주화를 {@YELLOW}드래곤 인연 포인트{@DEFAULT}와 다양한 아이템으로 교환할 수 있습니다.\n\n나르비의 변덕으로 상품이 주기적으로 바뀌는 특징이 있습니다.']='Narvi atidarė parduotuvę senovinėms monetoms rinkti savo tyrinėjimams.\nSenovines monetas, kurias renkate iš Senovinio bokšto, galite iškeisti į {@YELLOW} drakono santykių taškus{@DEFAULT} ir kitus daiktus. \n\nJi retkarčiais keičia parduodamas prekes, priklausomai nuo nuotaikos.',
['콜로세움은 다른 테이머들과 강함을 겨룰 수 있는 경쟁의 무대입니다.\n\n전투에 참가한 테이머는 {@YELLOW}명예{@DEFAULT}를 획득할 수 있으며 승패에 따라 순위가 변동됩니다.\n매주 주말마다 시즌이 종료되며 순위에 따라 {@YELLOW}용맹 훈장{@DEFAULT}과 다이아를 얻을 수 있습니다.\n\n콜로세움에서 획득한 명예와 용맹 훈장은 상점에서 특별한 상품들과 교환 할 수 있습니다.']='Koliziejus yra mūšio laukas, kuriame galite varžytis su kitais tramdytojais. \n\nKai prisijungiate prie kovos, galite gauti {@YELLOW} garbės apdovanojimą{@DEFAULT} ir būsite reitinguojami pagal rezultatą.\nKiekvienas sezonas baigiasi savaitgalį ir gausite {@YELLOW} narsumo medalį{@ DEFAULT} ir Deimantai pagal jūsų reitingą. \n\nGarbės ir narsumo medalį, kurį gavote Koliziejus , galite iškeisti į specialias prekes parduotuvėje.',
['오래된 유적에서 발견된 신기한 캡슐을 뽑을 수 있는 곳입니다.\n\n캡슐을 뽑기위해서는 유타칸의 장인들이 가공한 {@YELLOW}캡슐 코인{@DEFAULT}이 필요합니다.\n캡슐중에는 {@YELLOW}전설 드래곤{@DEFAULT}과 같이 희귀한 상품이 들어있는 것도 있어 테이머들에게 늘 인기입니다.']='Tai vieta, kur galite nupiešti paslaptingas kapsules, randamas senoviniuose griuvėsiuose. \n\nKad išpieštumėte kapsules, jums reikia {@YELLOW} kapsulinių monetų{@DEFAULT}, kurias apdirbo kalviai Jutakanas pasaulyje.\nKapsulės yra populiarios tarp tramdytojų, nes jose yra retų daiktų, tokių kaip {@YELLOW} legendiniai drakonai{@DEFAULT }.',
['수많은 테이머와 드래곤을 괴롭힌 악몽의 화신이 살고있는 던전입니다.\n그들의 처절했던 전투의 흔적과 함께 룬들이 곳곳에 떨어져 있어 테이머를 유혹합니다.\n\n악몽의 화신을 물리치면 룬을 얻을 수 있고 {@YELLOW}높은 단계로 갈수록 등급이 더 높은 룬{@DEFAULT}을 얻을 수 있습니다.']='Tai požemis, kuriame tiek daug tramdytojų ir drakonų užpuolė košmaro įsikūnijimas.\nPrijaukintojus vilioja visoje vietoje išsibarsčiusios runos kartu su beviltiškų kovų pėdsakais. \n\nKai nugalite košmaro įsikūnijimą, gausite runas. {@YELLOW} Kuo toliau, tuo aukštesnis Runų įvertinimas{@DEFAULT}.',
['테이머님과 드래곤이 휴식하고 서로 교감할 수 있는 숲입니다.\n\n{@YELLOW}숲의 레벨{@DEFAULT}을 올리면 더 많은 드래곤이 머무를 수 있고,\n시설의 레벨을 올릴 수 있어 보다 많은 보상을 얻을 수 있습니다.']='Miške tramdytojai ir drakonai gali ilsėtis ir bendrauti vieni su kitais. \n\nKuo aukštesnis {@YELLOW} jūsų miško lygis{@DEFAULT}, tuo daugiau drakonų gali pasilikti.\nTaip pat galite padidinti patalpų lygį, todėl gausite daugiau apdovanojimų.',
['유타칸의 테이머들은 혼자의 힘만으로는 물리칠 수 없는 어둠의 존재에 대항할 방법이 필요했습니다.\n클랜은 이러한 뜻이 맞는 테이머들이 연합할 수 있는 단체입니다.\n\n클랜에 소속되면 클랜 레벨에 따라 {@YELLOW}전용 버프 혜택{@DEFAULT}을 받을 수 있습니다.\n테이머는 클랜활동의 성과에 따라 상점에서 특별한 상품과 교환 할 수 있는 {@YELLOW}클랜코인{@DEFAULT}을 얻을 수 있습니다.']='Jutakanas pasaulyje tramdytojai turėjo rasti būdą, kaip susivienyti ir kovoti su tamsiosiomis jėgomis, kurių nepavyks nugalėti, jei jie kovotų vieni.\nKlanas – tai tam tikslui susivienijusi tramdytojų grupė. \n\nKai priklausote klanui, gaunate {@YELLOW} klano mėgėją{@DEFAULT}, priklausomai nuo klano lygio.\nAtsižvelgiant į klano veiklą, tramdytojai gauna {@YELLOW} klano monetų{@DEFAULT }, kuriuos parduotuvėje galima iškeisti į specialias prekes.',
['테이머 연합에서는 테이머들의 실력 향상을 위해 그림자의 신전을 만들었습니다.\n\n이곳에서는 전 세계의 우수한 테이머와 드래곤의 능력을 똑같이 가진 그림자가 나타납니다.\n하지만 이런 강력한 그림자에게 도전하기 위해서는 먼저 콜로세움에서 자신의 강함을 증명해야만 합니다.\n\n그림자의 신전에서는 룬을 연마할 수 있는 {@YELLOW}룬 연마석{@DEFAULT}을 획득 할 수 있습니다.']='Tamer Alliance pastatė šešėlių Šventykla , kad pagerintų tramdytojų gebėjimus ir įgūdžius. \n\nŠventykloje yra šešėlių, kurių statistika tokia pati kaip geriausių tramdytojų ir drakonų visame pasaulyje.\nTačiau norėdami kovoti su šešėliais, turite įrodyti savo jėgą Koliziejus. \n\nŠešėlių Šventykla galite gauti {@YELLOW} Rune Enchant Stone{@DEFAULT}.',
['고대의 탑에서 자신의 한계를 뛰어넘은 테이머만이 찾을 수 있는 신비로운 탑입니다.\n\n시험의 탑은 강력한 원소 에너지로 인해 {@YELLOW}탑과 같은 속성의 드래곤{@DEFAULT}만 전투에 참여할 수 있습니다.\n각 속성별 탑을 정복하면 한정 드래곤을 얻을 수 있는 {@YELLOW}절대적인 전설의 알{@DEFAULT}을 얻을 수 있습니다.']='Tik tie, kurie peržengė savo ribą Senoviniame bokšte, gali rasti šį paslaptingą bokštą. \n\nBandų bokšte tik {@YELLOW} drakonai, turintys tą patį atributą kaip bokštas{@DEFAULT}, gali stoti į mūšį dėl galingos elementinės energijos.\nKai išvalysite bokštą nuo kiekvieno atributo, galite gauti {@YELLOW} Absolute Legendary Kiaušinis{@DEFAULT}, kuris išsirita į ribotą drakoną.',
['어둠의 추종자가 부활시킨 강력한 기계 드래곤 엑스 마키나가 활동하고 있는 던전입니다.\n\n테이머 협회는 악명이 자자한 악몽던전에서도 살아 돌아온 뛰어난 테이머만의 입장을 허락하고 있습니다.\n{@YELLOW}총 10마리의 드래곤이 전투에 참가{@DEFAULT} 할 수 있으며, 엑스 마키나를 물리치면 특별한 능력을 가진 {@YELLOW}고대 룬{@DEFAULT}과 \n드래곤의 특성 레벨을 올리는 데 사용되는 {@YELLOW}아모르의 서{@DEFAULT}를 얻을 수 있습니다.']='Šiame požemyje gyvena Ex Machina – galingas mechaninis drakonas, kurį prikėlė tamsos pasekėjas. \n\nTamer aljansas leidžia patekti tik tiems, kurie išgyveno liūdnai pagarsėjusį košmarų požemį. \n{@YELLOW} Į mūšį gali prisijungti iki 10 drakonų {@DEFAULT}, o kai įveiksite buvusią mašiną, galite gauti {@YELLOW} senovinių runų{@DEFAULT}, kurios turi specialių įgūdžių ir\n{@YELLOW} Amorru{@DEFAULT} knygos, naudojamos meistriškumo lygiui pasiekti.',
['태초의 룬의 힘을 가졌다고 전해지는 룬 수호자가 지키는 던전입니다.\n\n룬 수호자 던전은 마력의 흐름이 불안정해 {@YELLOW}드래그 스킬을 사용할 수 없습니다{@DEFAULT}.\n총 6개의 던전으로 나누어진 룬 수호자 던전은, 각각의 던전마다 {@YELLOW}정해진 종류의 룬{@DEFAULT}을 얻을 수 있습니다.\n테이머는 원하는 종류의 룬을 얻기 위해 던전을 선택해 입장 할 수 있습니다.']='Šį požemį saugo Rune Guardian, kuris, kaip žinoma, turi pirmosios runos galią. \n\nRunų globėjų požemyje negalima naudoti {@YELLOW} vilkimo įgūdžių{@DEFAULT}, nes magijos srautas yra nestabilus.\nSusidedantis iš 6 požemių, galite gauti {@YELLOW} konkretaus tipo runą {@DEFAULT} kiekviename požemyje.\nGalite pasirinkti požemį, kad gautumėte norimą Runos tipą.',
['오랜세월 잠들어 있던 죄악의 화신이 어둠의 세력에 의해 되살아났습니다.\n클랜원들은 힘을 합쳐 죄악의 화신을 막아내야 합니다.\n\n클랜던전에서는 {@YELLOW}10마리의 드래곤{@DEFAULT}으로 전투를 진행하며 다른 클랜원이 전투중일 경우 입장할 수 없습니다.\n보스의 남은 체력은 모든 클랜원에게 공유되며 보스에게 승리하면 더 강한 보스에게 도전할 수 있습니다.\n\n클랜던전은 1주마다 시즌이 종료되며, {@YELLOW}보스에게 입힌 피해량에 따라 보상을 얻을 수 있습니다.{@DEFAULT}']='Nuodėmių įsikūnijimas buvo prikeltas tamsiosios jėgos po ilgo miego.\nDabar klano nariai turi susivienyti, kad kovotų su šia pikta jėga. \n\nKlano požemyje jūs kovojate su {@YELLOW} 10 drakonų{@DEFAULT} ir negalite patekti į požemį, kai jį užima kitas narys.\nBoso HP išlieka toks pat visiems klano nariams. Kai nugalite viršininką, galite kovoti su stipresniu viršininku. \n\nKiekvienas požemio sezonas trunka savaitę, o {@YELLOW} galite gauti atlygį pagal viršininkui padarytą žalą.{@DEFAULT}',
['모험 도중 우연히 만난 드래곤의 기억속에서 {@YELLOW}인연 포인트{@DEFAULT}를 얻을 수 있습니다.\n드래곤의 인연 포인트가 쌓이면 부화소에서 함께 할 수 있는 동료로 소환 할 수 있습니다.\n테이머님의 친구가 발견한 인연 던전에도 들어갈 수 있습니다.']='Uždirbkite {@YELLOW} santykių taškų{@DEFAULT} iš prisiminimų apie drakonus, kuriuos sutikote savo nuotykių metu.\nSu santykių taškais galite sukviesti draugus perykloje (Summon). \nTaip pat galite patekti į „Relationship Dungeons“, kuriuos rado jūsų draugai.',
['보유한 드래곤을 유타칸의 다양한 지역으로 {@YELLOW}탐험{@DEFAULT}을 보내 {@YELLOW}성장{@DEFAULT}시킬 수 있습니다.\n탐험을 보내기 위해서는 5마리의 드래곤이 필요하며, 탐험에서 발견한 룬과 자수정을 가지고 돌아옵니다.']='Siųskite savo drakonus {@YELLOW} tyrinėti{@DEFAULT} kitas Jutakanas sritis, kad pakiltumėte į {@YELLOW} lygį{@DEFAULT}.\nJums reikia mažiausiai penkių drakonų, kad juos išsiųstumėte tyrinėti. Grįžę jie sugrąžina rastas runas ir ametistus.',
['하루에 한번 {@YELLOW}저렴한 가격{@DEFAULT}으로 상품을 구매할 수 있습니다.\n고급소환권과 골드, 모험에서 사용가능한 경험치와 골드 부스터 상품을 판매하고 있습니다.']='Kartą per dieną galite įsigyti prekių už {@YELLOW} mažesnę kainą{@DEFAULT}.\nGalite įsigyti pažangių šaukimo bilietų, Auksas, Auksas stiprintuvų ir EXP, kuriuos galite naudoti savo nuotykių metu.',
['오랜 시간 유타칸 세계의 신비한 힘을 흡수해 살아 움직이게 된 {@YELLOW}거목{@DEFAULT}이 등장합니다.\n거목을 물리치면 드래곤의 친밀도를 올리는 {@YELLOW}열매{@DEFAULT}를 얻을 수 있습니다.\n요일에 따라 들어갈 수 있는 던전의 속성이 변화합니다.']='Yra {@YELLOW} masyvūs medžiai{@DEFAULT}, kurie atgijo po to, kai sugėrė paslaptingą Jutakanas galią.\nKai nugalėsite tuos medžius, galite gauti įvairių {@YELLOW} vaisių{@DEFAULT} ir padidinti savo artumą su drakonais .\nPožemio atributai, kuriuos galite įvesti, keičiasi kiekvienai savaitės dienai.',
['거대용들을 물리치면 {@YELLOW}드래곤을 진화{@DEFAULT}시킬 수 있는 {@YELLOW}보석과 정기{@DEFAULT}를 얻을 수 있습니다.\n진화한 드래곤은 모습이 변화하며 새로운 스킬을 얻어 더욱 강해집니다.\n요일에 따라 들어갈 수 있는 던전의 속성이 변화합니다.']='Kai nugalite Massive Dragons, gausite {@YELLOW} Evoliucija Gem ir energijos{@DEFAULT}, kurios suaktyvina {@YELLOW} drakonų Evoliucija {@DEFAULT}.\nKai drakonas išsivysto, jis keičia savo išvaizdą ir tampa galingesnis su naujais įgūdžiais.\nPožemio atributai, kuriuos galite įvesti, keičiasi kiekvienai savaitės dienai.',
['먼 옛날부터 테이머들이 자신을 시험하기 위해 올라갔다고 하는 전설의 탑입니다.\n매 층 클리어 시 다양한 보상을 얻을 수 있으며, {@YELLOW}층별 점수에 따라 순위가 결정{@DEFAULT}됩니다.\n고대의 탑은 2주마다 시즌이 종료되며 순위에 따라 {@YELLOW}고대주화{@DEFAULT}를 얻을 수 있습니다.']='Legendinis bokštas, į kurį Tamers seniai kopė norėdami išbandyti save. \nIšvalę kiekvieną aukštą gaunate įvairių apdovanojimų ir esate {@YELLOW} reitinge, remiantis taškais, kuriuos surinkote už kiekvieną aukštą{@DEFAULT}.\nKiekvienas Senovinio bokšto sezonas trunka 2 savaites, o jūs galite gauti {@YELLOW} Senovinės monetos{@DEFAULT} pagal jūsų reitingą.',
['마녀 나르비는 자신의 연구에 필요한 고대 주화를 수집하기 위해 상점을 열었습니다.\n고대의 탑에서 얻은 고대 주화를 {@YELLOW}드래곤 인연 포인트{@DEFAULT}와 다양한 아이템으로 교환할 수 있습니다.\n나르비의 변덕으로 상품이 주기적으로 바뀌는 특징이 있습니다.']='Narvi atidarė parduotuvę, kad rinktų senovines monetas savo tyrinėjimams.\nSenovines monetas, kurias renkate iš Senovinio bokšto, galite iškeisti į {@YELLOW} drakono santykių taškus{@DEFAULT} ir kitus daiktus.\nJi keičia parduodamas prekes kaskart kartais, priklausomai nuo jos nuotaikos.',
['콜로세움은 다른 테이머들과 강함을 겨룰 수 있는 경쟁의 무대입니다.\n전투에 참가한 테이머는 {@YELLOW}명예{@DEFAULT}를 획득할 수 있으며 승패에 따라 순위가 변동됩니다.\n매주 주말마다 시즌이 종료되며 순위에 따라 {@YELLOW}용맹 훈장{@DEFAULT}과 다이아를 얻을 수 있습니다.']='Koliziejus yra mūšio laukas, kuriame galite varžytis su kitais tramdytojais.\nKai prisijungiate prie kovos, galite gauti {@YELLOW} garbę{@DEFAULT} ir būsite reitinguojami pagal rezultatą.\nKiekvienas sezonas baigiasi savaitgalį ir gausite {@YELLOW} Valor medalį{@DEFAULT} ir Deimantai pagal savo reitingą.',
['오래된 유적에서 발견된 신기한 캡슐을 뽑을 수 있는 곳입니다.\n캡슐을 뽑기위해서는 유타칸의 장인들이 가공한 {@YELLOW}캡슐 코인{@DEFAULT}이 필요합니다.\n캡슐중에는 {@YELLOW}전설 드래곤{@DEFAULT}과 같이 희귀한 상품이 들어있는 것도 있어 테이머들에게 늘 인기입니다.']='Tai vieta, kur galite piešti paslaptingas kapsules, randamas senoviniuose griuvėsiuose.\nKad piešti kapsules, jums reikia {@YELLOW} kapsulinių monetų{@DEFAULT}, kurias apdirbo kalviai Jutakanas pasaulyje.\nKapselės yra populiarios tarp tramdytojų, nes juose yra retų daiktų, pvz., {@YELLOW} legendiniai drakonai{@DEFAULT}.',
['수많은 테이머와 드래곤을 괴롭힌 악몽의 화신이 살고있는 던전입니다.\n그들의 처절했던 전투의 흔적과 함께 룬들이 곳곳에 떨어져 있어 테이머를 유혹합니다.\n악몽의 화신을 물리치면 룬을 얻을 수 있고 {@YELLOW}높은 단계로 갈수록 등급이 더 높은 룬{@DEFAULT}을 얻을 수 있습니다.']='Tai požemis, kuriame tiek daug tramdytojų ir drakonų užpuolė košmaro įsikūnijimas.\nPrijaukintojus vilioja visoje vietoje išsibarsčiusios runos kartu su beviltiškų kovų pėdsakais.\nKai nugalite Košmaro Įsikūnijimą, gausite Runas . {@YELLOW} Kuo toliau, tuo aukštesnis Runų įvertinimas{@DEFAULT}.',
['테이머님과 드래곤이 휴식하고 서로 교감할 수 있는 숲입니다.\n{@YELLOW}숲의 레벨{@DEFAULT}을 올리면 더 많은 드래곤이 머무를 수 있고,\n시설의 레벨을 올릴 수 있어 보다 많은 보상을 얻을 수 있습니다.']='Miške tramdytojai ir drakonai gali ilsėtis ir bendrauti vieni su kitais.\nKuo aukštesnis {@YELLOW} jūsų miško lygis{@DEFAULT}, tuo daugiau drakonų gali pasilikti.\nTaip pat galite padidinti patalpų lygį, kuris suteikia daugiau atlygių.',
['클랜에 소속되면 클랜 레벨에 따라 {@YELLOW}전용 버프 혜택{@DEFAULT}을 받을 수 있습니다.\n테이머는 클랜활동의 성과에 따라 상점에서 특별한 상품과 교환 할 수 있는 {@YELLOW}클랜코인{@DEFAULT}을 얻을 수 있습니다.']='Kai priklausote klanui, gaunate {@YELLOW} klano mėgėją{@DEFAULT}, priklausomai nuo klano lygio.\nAtsižvelgiant į klano veiklą, tramdytojai gauna {@YELLOW} klano monetų{@DEFAULT}, kurios gali parduotuvėje iškeisti į specialias prekes.',
['이곳에서는 전 세계의 우수한 테이머와 드래곤의 능력을 똑같이 가진 그림자가 나타납니다.\n하지만 이런 강력한 그림자에게 도전하기 위해서는 먼저 콜로세움에서 자신의 강함을 증명해야만 합니다.\n그림자의 신전에서는 룬을 연마할 수 있는 {@YELLOW}룬 연마석{@DEFAULT}을 획득 할 수 있습니다.']='Šventykloje yra šešėlių, kurių statistika yra tokia pati kaip geriausių tramdytojų ir drakonų visame pasaulyje.\nTačiau norėdami kovoti su šešėliais, turite įrodyti savo jėgą Koliziejus.\nŠešėlių Šventykla galite gauti {@YELLOW} Rune Enchant Stone{@DEFAULT}.',
['고대의 탑에서 자신의 한계를 뛰어넘은 테이머만이 찾을 수 있는 신비로운 탑입니다.\n시험의 탑은 강력한 원소 에너지로 인해 {@YELLOW}탑과 같은 속성의 드래곤{@DEFAULT}만 전투에 참여할 수 있습니다.\n각 속성별 탑을 정복하면 한정 드래곤을 얻을 수 있는 {@YELLOW}절대적인 전설의 알{@DEFAULT}을 얻을 수 있습니다.']='Šį paslaptingą bokštą gali rasti tik tie, kurie viršijo savo ribą Senovės bokšte.\nBandymų bokšte tik {@YELLOW} drakonai, turintys tokį patį atributą kaip bokštas{@DEFAULT}, gali stoti į mūšį dėl galingo elemento energijos.\nKai išvalysite bokštą nuo kiekvieno atributo, galite gauti {@YELLOW} Absolute Legendary Kiaušinis{@DEFAULT}, kuris išsirita į ribotą drakoną.',
['어둠의 추종자가 부활시킨 강력한 기계 드래곤 엑스 마키나가 활동하고 있는 던전입니다.\n{@YELLOW}총 10마리의 드래곤이 전투에 참가{@DEFAULT} 할 수 있으며, 엑스 마키나를 물리치면 특별한 능력을 가진 {@YELLOW}고대 룬{@DEFAULT}과 \n드래곤의 특성 레벨을 올리는 데 사용되는 {@YELLOW}아모르의 서{@DEFAULT}를 얻을 수 있습니다.']='Šiame požemyje gyvena Ex Machina – galingas mechaninis drakonas, kurį prikėlė tamsos pasekėjas. \n{@YELLOW} Į mūšį gali prisijungti iki 10 drakonų {@DEFAULT}, o kai įveiksite buvusią mašiną, galite gauti {@YELLOW} senovinių runų{@DEFAULT}, kurios turi specialių įgūdžių ir\n{@YELLOW} Amorru{@DEFAULT} knygos, naudojamos meistriškumo lygiui pasiekti.',
['태초의 룬의 힘을 가졌다고 전해지는 룬 수호자가 지키는 던전입니다.\n룬 수호자 던전은 마력의 흐름이 불안정해 {@YELLOW}드래그 스킬을 사용할 수 없습니다{@DEFAULT}.\n총 6개의 던전으로 나누어진 룬 수호자 던전은, 각각의 던전마다 {@YELLOW}정해진 종류의 룬{@DEFAULT}을 얻을 수 있습니다.']='Šį požemį saugo Rune Guardian, kuris, kaip žinoma, turi pirmosios runos galią.\nRunų globėjų požemyje negalima naudoti {@YELLOW} vilkimo įgūdžių{@DEFAULT}, nes magijos srautas yra nestabilus.\nSusidaro iš 6 požemių, kiekviename požemyje galite gauti {@YELLOW} konkretaus tipo runą{@DEFAULT}.',
['클랜던전에서는 {@YELLOW}10마리의 드래곤{@DEFAULT}으로 전투를 진행하며 다른 클랜원이 전투중일 경우 입장할 수 없습니다.\n보스의 남은 체력은 모든 클랜원에게 공유되며 보스에게 승리하면 더 강한 보스에게 도전할 수 있습니다.\n클랜던전은 1주마다 시즌이 종료되며, {@YELLOW}보스에게 입힌 피해량에 따라 보상을 얻을 수 있습니다.{@DEFAULT}']='Klano požemyje jūs kovojate su {@YELLOW} 10 drakonų{@DEFAULT} ir negalite patekti į požemį, kai jį užima kitas narys.\nBoso HP išlieka toks pat visiems klano nariams. Kai nugalite viršininką, galite kovoti su stipresniu viršininku.\nKiekvienas požemio sezonas trunka savaitę, o {@YELLOW} galite gauti atlygį pagal viršininkui padarytą žalą.{@DEFAULT}',
