['{@yellow}강력한 패시브 회복{@default} 능력을 가지고 있어 드래그 스킬을 사용하지 않아도 아군을 효과적으로 회복할 수 있습니다.\n면역 효과로 아군이 해로운 효과에 걸리지 않도록 합니다.']='Dėl {@yellow} galingo pasyvaus gydymo gebėjimo {@default} , Pajėgus sąjungininkus net nenaudodamas vilkimo įgūdžių.\nSuteikia sąjungininkams imunitetą nuo statuso negalavimų.',
