['아군의 {@yellow}드래그 스킬 재사용 시간과 마나 소비량을 감소{@default}시켜 드래그 스킬을 더 자주 발동할 수 있게 지원해줍니다.\n드래그 스킬 발동 회수가 많아지면 클랜던전의 점수 증가에 큰 도움이 됩니다.']='Leidžia dažniau naudoti vilkimo įgūdžius, nes {@yellow} sumažina sąjungininkų įgūdžių atšalimą ir MP kainą {@default}.\nDažnesnis vilkimo įgūdžių perdavimas yra naudingas siekiant aukštų taškų Klano požemyje.',
