['후방 아군에게 {@yellow}공격력 증가 효과를 2개 부여{@default}하는 스킬을 가지고 있습니다.\n클랜던전에서 공격형 아군의 피해량을 높이는데 큰 도움을 줄 수 있습니다.']='Turi įgūdį, kuris {@yellow} suteikia du ATK stiprinimo mylėtojus {@default} galiniams sąjungininkams.\nLabai naudinga didinant Atakos tipo sąjungininkų žalą Klano požemyje.',
['생명력이 모두 감소하면 {@yellow}좀비{@default} 효과가 발동되어 공격 스킬이 강화됩니다.\n좀비 효과는 모든 컨텐츠에서 효과적이지만 특히 모험 스테이지를 돌파하는데 큰 도움을 줍니다.']='Tampa {@yellow} zombiu {@default} , kai HP pasiekia nulį, todėl puolimo įgūdžiai tampa galingesni.\nZombio būsena veikia visais režimais, tačiau ji ypač naudinga išvalant Nuotykis etapus.',
['{@yellow}보호막, 무적, 부활{@default} 능력을 가지고 있어 아군 보호, 생존에 특화되어 있습니다.\n아군의 생존이 중요한 콜로세움에서 효과적입니다.']='Specializuojasi sąjungininkų apsaugos ir išlikimo srityje dėl savo {@yellow} barjero, nepažeidžiamumo ir atgaivinimo {@default} sugebėjimų.\nYpač efektyvus Koliziejus, kur svarbus sąjungininkų išlikimas.',
['재사용 시간이 짧고  {@yellow}많은 수의 적을 공격{@default}하는 패시브 스킬을 가지고 있습니다.\n많은 수의 몬스터를 빠르게 처치할 수 있어 고대의 탑, 룬 수호자 던전에서 클리어 시간을 단축시킬 수 있습니다.']='Turi pasyvų įgūdį ir trumpą atvėsimą, kuris gali {@yellow} atakuoti kelis taikinius {@default}.\nJis gali padėti sutrumpinti Senovės bokšto ar Runų globėjų požemių laiką, per trumpą laiką įveikdamas daug monstrų.',
