['이 드래곤의 분노는 빛을 향해 있습니다. 이 공격은 방어력, 수호, 무적, 부활등의 모든 방어 수단을 무시하며 빛 속성 대상에게는 20배의 피해를 입힙니다.전투 시작 시에 1회만 발동합니다.']='Šio drakono pyktis nukreiptas į šviesą. Ši ataka ignoruoja visas gynybines priemones, tokias kaip gynyba, apsauga, nenugalimas, prisikėlimas ir kt., ir padaro 20 kartų daugiau žalos šviesos objektams. Jis suaktyvinamas tik vieną kartą mūšio pradžioje.',
['이벤트 기간 동안 파멸의 어둠 소환에 사용할 수 있는 소환권, 낮은 확률이지만, 파멸의 다크닉스을 소환할 수 있다고 한다.']='Renginio metu yra iškvietimo bilietas, kurį galima naudoti griuvėsių tamsos iškvietime. Nors tai maža tikimybė, sakoma, kad Summon Darknix of Ruin galima iškviesti.',
['이벤트 기간 동안 파멸의 어둠 이벤트 상점에서 사용할 수 있는 재화, 이벤트 스테이지나 이벤트 업적을 통해 획득할 수 있다.']='Renginio laikotarpiu galite įsigyti valiutos, kurią galėsite panaudoti griuvėsių parduotuvėje, taip pat renginio etapus ir pasiekimus.',
