['일정 시간마다 무작위 적을 공격합니다.\n매 타격마다 공격력 감소 효과를 부여합니다.\n보스 공격 시 타겟이 적을수록 피해량이 증가합니다.']='Reguliariai atakuokite atsitiktinius priešus.\nSuteikite žalos mažinimo efektą su kiekvienu smūgiu.\nŽala didėja, kai puolate priešus boso atakų metu.',
['일정 횟수의 일반 공격 시마다 자신의 목적을 상기시킵니다. 목적을 이루기 전 까지 발악하여 자신의 생명력을 회복합니다. 보유하고 있는 공격력 감소를 제외한 중첩 가능한 해로운 효과(방어력 감소, 공격 속도 감소, 지속 피해)의 중첩 개수 1개당 회복량이 4배로 증가합니다.']='Kiekvieną kartą, kai atliekate tam tikrą skaičių įprastų atakų, primenate sau apie savo tikslą. Kol nepasieksite savo tikslo, atgausite savo sveikatą jam prieštaraudami. Už kiekvieną žalingų efektų krūvą, kurią galima sukrauti, neįskaitant puolimo galios sumažinimo (gynybos sumažinimas, puolimo greičio mažinimas, nuolatinė žala), atkūrimo suma padidinama 4 kartus.',
['일정시간마다 가장 공격력이 높은 대상에게 10회에 걸쳐 튕기는 구체가 모든 방어 수단을 무시한 피해를 가합니다. 대상의 공격력이 낮을수록 피해량이 상승하며, 만약 대상의 공격력이 25000이상일 경우 피해가 무효화 됩니다.']='Kas tam tikrą laiką atšokusi sfera padaro žalą taikiniui su didžiausia atakos galia virš 10 smūgių, nepaisydama visų gynybos priemonių. Žalos dydis didėja mažėjant taikinio puolimo galiai, o jei taikinio puolimo galia yra 25 000 ar daugiau, žala anuliuojama.',
['자신의 생명력이 0이 되면 40초간 좀비 상태가 되고, 치명 확률이 비약적으로 증가합니다.\n이 때, 스킬 쿨타임이 초기화되며 마나 2를 회복합니다. \n지속 시간이 끝난 뒤 사망합니다.']='Jei jūsų gyvybingumas pasieks 0, 40 sekundžių pateksite į zombio būseną, o jūsų kritinė tikimybė smarkiai padidės.\nPer šį laiką jūsų įgūdžių atšalimas bus iš naujo nustatytas ir atgausite 2 manus.\nPasibaigus trukmei mirti.',
