['축복 시즌은 3개월마다 변경되며 , 각 시즌 별로 특화된 옵션이 존재합니다.\n축복은 3개월 마다 {@YELLOW}초기화{@DEFAULT}가 되고 사용 중인 축복은 종료 됩니다.\n등록한 드래곤은 새로운 시즌이 시작되면 초기화 되고 재등록이 필요합니다.']='Palaiminimo sezonas keičiasi kas 3 mėnesius, o kiekvienam sezonui yra specialių parinkčių.\nBlessing Season tampa {@YELLOW} inicijavimu{@DEFAULT} kas 3 mėnesius, o šiuo metu naudojamas palaiminimas bus nutrauktas.\nUžregistruotas drakonas bus nustatytas iš naujo, kai prasidės naujas sezonas, todėl reikės iš naujo registruotis.',
