['드래곤을 등록 후 얻은 축복 티켓을 사용하여 축복을 받을 수 있습니다.\n\n축복은 5개의 타입이 있으며 원하지 않은 옵션이 나왔을때 다이아를 소모하여 옵션을 {@YELLOW}초기화{@DEFAULT}할 수 있습니다.\n- 초기화 시 해당 옵션에서 사용한 축복 티켓이 모두 반환됩니다.\n\n축복은 중첩이 가능하며 모든 드래곤,콘텐츠에서 적용이 됩니다.']='Užregistravę drakoną, galite naudoti palaiminimo bilietą, kad gautumėte palaiminimą. \n\nLaiminimas yra 5 tipų, o kai atsiranda nepageidaujama parinktis, galite naudoti deimantą, kad {@YELLOW} iš naujo nustatytumėte{@DEFAULT} parinktį. \n– inicijuojant bus grąžintas visas palaiminimo bilietas, naudojamas pasirinkime. \n\nLaiminimas yra sukraunamas ir taikomas visiems drakonams ir turiniui.',
['전설 드래곤은 {@YELLOW}축복 티켓{@DEFAULT} 3개.\n신화 드래곤은 스킬 강화 단계에 따라 {@YELLOW}축복 티켓{@DEFAULT}이 지급 됩니다. (최대 15개 까지 획득 가능합니다.)\n\n신화 드래곤을 등록후 , 스킬 레벨업을 한뒤에 축복 시스템에 재 등록시 강화한 스킬 레벨 1당 축복 티켓 1개가 추가 지급됩니다.']='Legendinis drakonas turi 3 {@YELLOW} palaiminimo bilietus{@DEFAULT}.\nAtsižvelgiant į įgūdžių tobulinimo lygį, Mythic Dragon gaus {@YELLOW} palaiminimo bilietą{@DEFAULT}. (Galite įsigyti iki 15 daiktų. ) \n\nUžregistravę mitinį drakonas, kai paaukštinsite savo įgūdžius ir iš naujo užsiregistruosite palaiminimo sistemoje, gausite papildomą palaiminimo bilietą už kiekvieną įgūdžių tobulinimo lygį.',
['축복 티켓을 얻기 위해서는 {@YELLOW}육성이 완료된{@DEFAULT} 전설, 신화 드래곤을 등록해야 합니다.\n\n- 전설 드래곤 : 레벨 / 친밀도 / 강화 / 특성 / 진화 / 스킬\n- 신화 드래곤 : 레벨 / 친밀도 / 진화\n\n드래곤을 등록하여도 모든 콘텐츠에서 사용 가능합니다.\n동일한 드래곤을 여러마리 육성하여 등록하여도 , 한마리만 등록 가능합니다.']='Norėdami gauti palaiminimo bilietą, turite užregistruoti drakoną, kuris baigė {@YELLOW} pilną auklėjimą{@DEFAULT}. \n\n- Legendinis drakonas : lygis / artumas / tobulinimas / meistriškumas / tobulėjimas / įgūdžiai \n- mitinis drakonas : lygis / uždarumas / tobulėjimas \n\nNet jei užregistruosite drakoną, jį bus galima naudoti visame turinyje. \nNet jei registruojate kelis drakonus, galima užregistruoti tik vieną.',
['진정한 테이머가 되기 위한 길입니다.\n최대한 많은 드래곤을 육성 시켜 축복 시스템에 등록시키고, 획득한 {@YELLOW}축복 티켓{@DEFAULT}을 사용하여 {@YELLOW}축복 효과{@DEFAULT}를 받아보세요.']='Tai kelias, kaip tapti tikru tramdytoju.\nAuklinkite kuo daugiau drakonų, užregistruokite juos palaiminimo sistemoje ir naudokite įgytus {@YELLOW} palaiminimo bilietus{@DEFAULT}, kad gautumėte {@YELLOW} palaiminimo efektų{@DEFAULT} .',
['드래곤을 등록 후 얻은 축복 티켓을 사용하여 축복을 받을 수 있습니다.\n\n축복은 5개의 타입이 있으며 원하지 않은 옵션이 나왔을때 다이아를 소모하여 옵션을 {@YELLOW}초기화{@DEFAULT}할 수 있습니다.\n- 초기화 시 해당 옵션에서 사용한 축복 티켓이 모두 반환됩니다.\n\n축복은 중첩이 가능하며 모든 드래곤,콘텐츠에서 적용이 됩니다.\n\n특화 옵션 15단계와 기본 옵션의 10단계의 확률은 동일하며 , 특화 옵션일수록 더 높은 수치의 옵션을 획득할 확률이 높습니다.']='Užregistravę drakoną, galite naudoti palaiminimo bilietą, kad gautumėte palaiminimą. \n\nLaiminimas yra 5 tipų, o kai atsiranda nepageidaujama parinktis, galite naudoti deimantą, kad {@YELLOW} iš naujo nustatytumėte{@DEFAULT} parinktį. \n– inicijuojant bus grąžintas visas palaiminimo bilietas, naudojamas pasirinkime. \n\nLaiminimas yra sukraunamas ir taikomas visiems drakonams ir turiniui. \n\nTikimybė gauti specializuotą opcioną 15 lygiu ir pagrindinį 10 lygio pasirinkimo sandorį yra vienoda, tačiau didesnės vertės opciono įsigijimo tikimybė yra didesnė specializuotiems opcionams.',
