['모험 난이도 불지옥 이상 클리어 시 아모르의 기운이 획득됩니다.\n더 높은 단계의 모험 클리어 시 아모르의 기운을 더욱 많이 획득할 수 있습니다.\n아모르의 기운을 사용하여 연구를 통해 드래곤의 능력치를 올릴 수 있습니다.\n육체와 영혼 둘 중 하나를 선택하여 능력치를 올릴 수 있으며, 다이아를 사용하여 초기화가 가능합니다.\n능력치는 영구적으로 적용이 됩니다.']='Kai išvalysite nuotykių sunkumą Hellfire ar aukštesnį, gausite meilės energiją.\nKai išvalysite nuotykius aukštesniame lygyje, galite įgyti dar daugiau meilės energijos.\nNaudodami meilės energiją galite padidinti našumą drakoną tyrinėdami.\nGalite pasirinkti kūną arba sielą, kad padidintumėte savo sugebėjimus, ir galite jį atkurti naudodami deimantus.\nGebėjimų statistika taikoma visam laikui.',
['아모르가 유타칸 대륙 곳곳에 적들을 상대하기 쉽도록 자신의 기운({@YELLOW}아모르의 기운{@DEFAULT})을 남겼습니다.\n기운을 회수하고 {@YELLOW}연구{@DEFAULT}하여 더욱더 강력해진 적들은 상대해 보세요.']='Amoras paliko savo energiją ({@YELLOW} Amoro energija{@DEFAULT}) įvairiose Jutakanas žemyno vietose, kad būtų lengviau susidoroti su priešais.\nAtgauk energijos ir susidurk su stipresniais priešais, kurie tapo dar galingesni. po {@YELLOW} tyrimo{@DEFAULT}.',
['아모르의 힘이 미약하게 느껴지는 결정']='Amoro jėga jaučiasi šiek tiek silpna.',
['오염된 바다를 깨끗하게 정화하는 고래 드래곤이다. 이마에 있는 장신구로  오염된 물을 정화시키며, 물이 없는 하늘도 자유롭게 날 수 있다. 주변을 맴도는 물과 빛나는 푸른빛은 생명력을 치유하는 힘이 담겨있다고 한다.']='Banginis drakonas yra padaras, kuris valo užterštą vandenyną ir jį valo. Jis išvalo užterštą vandenį su priedu ant kaktos ir gali laisvai skristi danguje be vandens. Sakoma, kad aplinkinis vanduo ir spindinti mėlyna šviesa turi galią gydyti gyvybingumą.',
['일정 시간마다 전방의 적을 공격하고 {1}% 확률로 {2}초간 침묵시킵니다. 자신의 방어력에 따라 위력이 크게 증가합니다.']='Kas tam tikrą laiką atakuoja priešus priešais ir turi {1}% galimybę nutildyti {2} sek. Padaro žymiai daugiau žalos, priklausomai nuo DEF.',
['체스토(물)']='Chesto (Vanduo)',
['치유의 물방울로 대상의 생명력을 회복하고 {1}초간 면역 효과를 부여합니다.\n자신의 방어력에 따라 회복량이 증가합니다.']='Atkurkite taikinio gyvybingumą naudodami gydymo lašelius ir suteikite imuniteto efektą {1} sek.\nGydymo kiekis didėja, atsižvelgiant į jo DEF.',
['해수로 해로운 효과를 씻어냅니다. 일정 시간마다 모든 아군의 생명력을 {1}초에 걸쳐 {2}% 회복하고, 해로운 효과를 1개 해제합니다.']='Nuplauna žalingą jūros vandens poveikį. Kiekvienas sąjungininkų padalinys atkuria HP kas tam tikrą laiką {2}% greičiu per {1} sekundę ir 1 kartą pašalina žalingą poveikį.',
['가장 오래된 주술의 힘으로 적을 공격합니다. 자신의 효과적중(최대 200)에 따라 피해가 크게 증가하며 대상에게 걸린 모든 해로운 효과를 다른 적 {1}명에게 {2}% 확률로 전염시킵니다.']='Atakuoja priešą seniausio būrimo galia. Žala žymiai padidėja priklausomai nuo atakos efektyvumo (daugiausia 200) ir yra {2}% tikimybė, kad visas žalingas poveikis taikiniui pasklistų {1} kitiems priešams.',
['강렬한 불꽃을 뿜어서 적에게 피해를 줍니다. 자신의 치명 피해(최대 300)에 따라 위력이 크게 증가합니다.']='Skleiskite mirtiną liepsną, kad padarytumėte žalos priešams. Galia labai padidėja proporcingai jūsų kritiniam DMG (maksimaliai 300).',
['대상에게 카드를 난사하여 피해를 줍니다.\n자신의 치명 피해(최대 300)에 따라 위력이 크게 증가합니다.']='Šaudykite kortomis, kad padarytumėte žalos.\nGalia labai padidėja, proporcingai jūsų kritiniam DMG (maksimaliai 300).',
['뜨거운 태양의 열기로 적에게 피해를 줍니다. 자신의 치명 피해(최대 300)에 따라 위력이 크게 증가합니다.']='Padarykite žalą saulės šiluma.\nŽala labai padidėja, proporcingai jūsų kritiniam DMG (maksimaliai 300).',
['뜨거운 태양의 열기로 적에게 피해를 줍니다. 자신의 치명 확률(최대 200)에 따라 위력이 크게 증가합니다.']='Padarykite žalą svilinančia saulės šiluma. Galia labai padidėja proporcingai jūsų kritiniam rodikliui (maksimaliai 200).',
['마력의 힘으로 적에게 피해를 줍니다. 자신의 치명 확률(최대 200)에 따라 위력이 크게 증가합니다.\n이 스킬로 적을 처치하면 자신의 생명력을 {2}% 회복하며 다음 시전되는 이 스킬의 마나 사용량이 {3} 감소됩니다.']='Magiškai puola priešus. Kuo didesnis jo CRIT rodiklis (maksimalus 200), magiškai atakuoja priešus. Kuo didesnis jo CRIT rodiklis, tuo didesnė žala.\nŠio įgūdžio nugalėti priešai atkuria {2}% HP ir sumažina jo Mana kainą {3} kitam naudojimui. Tuo didesnė žala.\nŠio įgūdžio nugalėti priešai atkurti {2}% HP ir sumažinti Mana kainą {3} kitam naudojimui.',
['마법진의 강대한 마력으로 적에게 피해를 줍니다.\n자신의 치명 피해(최대 300)에 따라 위력이 크게 증가합니다.']='Padarykite žalą priešams naudodamiesi magiškojo rato galia.\nJėga labai padidėja, proporcingai jūsų kritiniam DMG (maksimaliai 300).',
['맹렬하게 달려들어 적들에게 피해를 줍니다.\n자신의 치명 피해(최대 300)에 따라 위력이 크게 증가합니다.']='Agresyviai įkraukite, kad padarytumėte žalą.\nGalima labai padidėja, proporcingai jūsų kritiniam DMG (maksimaliai 300).',
['모든 증오를 담아 강력한 마법으로 적에게 피해를 줍니다.\n치명 확률(최대 200)에 따라 위력이 크게 증가합니다.\n보스 공격 시 타겟이 적을수록 피해량이 증가합니다.']='Jis daro žalą priešams galinga magija, apimančia visą neapykantą.\nJo galia žymiai padidėja priklausomai nuo kritinės tikimybės (maksimaliai 200).\nPuoluojant bosą, žala didėja, nes taikinys tampa priešu.',
['발톱으로 적들을 매섭게 할퀴어 피해를 줍니다.\n자신의 치명 피해(최대 300)에 따라 위력이 증가합니다.']='Padarykite žalą įnirtingai draskydami priešus nagais.\nGalia padidinama proporcingai kritiniam DMG (maksimaliai 300).',
