['빠른 속도로 회전하며 적 사이를 튕겨다니며 피해를 줍니다.\n자신의 치명 피해(최대 300)에 따라 위력이 크게 증가합니다.\n자신에게 피해 반사 효과가 적용 중이면 최종 피해량이 1.5배가 됩니다.']='Padarykite žalą atmušdami priešus, kai sukasi greitai.\nGalia labai padidėja, proporcingai jūsų kritiniam DMG (maksimaliai 300).\nKai turite žalos atspindžio efektą, galutinė žala padauginama iš x1,5.',
['사탕을 떨어뜨려 적에게 피해를 줍니다. 자신의 치명 피해(최대 300)에 따라 위력이 크게 증가합니다.']='Meskite saldainius, kad padarytumėte žalos priešams. Galia labai padidėja proporcingai jūsų kritiniam DMG (maksimaliai 300).',
