['위대한 의지의 힘으로 아군을 축복하여 생명력을 회복하고 {1}초간 방어력을 증가시킵니다. 자신의 효과 적중(최대 200)에 따라 회복량이 증가합니다.']='Didžiosios valios jėga palaimina sąjungininkus, atkurdama jų HP ir padidindama jų DEF {1} sek. Gydomasis kiekis didėja, priklausomai nuo jo poveikio ACC (maksimalus 200) ir gynybos.',
['응축된 번개로 적에게 피해를 줍니다.\n자신의 치명 피해(최대 300)에 따라 위력이 크게 증가합니다.']='Padarykite žalą priešui labai kondensuotu žaibu.\nPagal jūsų išsisukinėjimą (maksimaliai 300), galia žymiai padidėja.',
