['일정 시간마다 전방의 적에게 피해를 줍니다. 자신의 치명 피해(최대 300)에 따라 위력이 크게 증가합니다.\n지원형과 회복형 적에게는 {1}% 확률로 {2}초간 침묵시킵니다.']='Kiekviena nustatyta trukmė daro žalą priešams priekyje. Žala labai padidėja priklausomai nuo drakono kritinio DMG (maksimaliai 300).\nNutildykite palaikymo ir gydytojų tipo priešus {2} sek. su {1}% tikimybe.',
