['재빠른 찌르기로 적에게 피해를 줍니다. 이 스킬은 발동할 때 마다 위력이 {1}% 증가하며(최대 {2}%),\n자신의 효과 저항(최대 200)에 따라 피해량이 크게 증가합니다.']='Greitai smeigia į priešus. Šio įgūdžio galia padidėja {1}%, iki {2}%, kiekvieną kartą, kai jis metamas.\nBe to, jo žala žymiai padidėja, atsižvelgiant į drakono atsparumą poveikiui (daugiausia 200).',
