['합동 마법을 영창하여 적에게 피해를 줍니다.\n자신의 치명 확률(최대 200)에 따라 위력이 크게 증가합니다.']='Paleiskite sąnario magiją, kad padarytumėte žalą.\nGalima labai padidėja proporcingai jūsų kritiniam greičiui (maksimaliai 200).',
