['-드래그 스킬 안내-\n\n잘하는데?! 다크닉스에게 지속피해가 걸렸어. 최대 생명력에 비례에서 주는 피해이기 때문에 보스전에 아주 유용해.']='- Vilkite įgūdžių vadovą-\n\n\nJums sekasi puikiai! Darknix kenčia nuo DOT žalos. Įgūdžio žala prilygsta priešininko Max HP, todėl jis yra gana naudingas prieš bosus.',
