['소년은 생명의 은인인 남자에게 이름을 묻자 남자는 대답하였다.']='Kai berniukas paklausė vyro, kuris buvo jo gyvybės gelbėtojas, vardo, vyras atsakė.',
['내 이름은 \'로버트 테일러\', 드래곤 테이머야! 그리고 나의 드래곤인 번개고룡!']='Mano vardas „Robert Taylor“, drakonas tramdytojas! Ir mano drakonas yra Žaibo drakonas!',
['로버트 테일러']='Robertas Tayloras',
['소년은 번개고룡을 보며 감동했고 자신이 발견한 드래곤 알을 테일러에게 전해주었다.']='Žiūrėdamas „Žaibo drakonas“ berniukas buvo sujaudintas ir perdavė Teilorui atrastą drakono kiaušinį.',
['소문은 빠르게 퍼져 나갔고 왕국의 왕에게까지 보고되었다.']='Gandas greitai pasklido ir buvo pranešta karalystės karaliui.',
['각국의 왕들은 로버트 테일러와 번개고룡을 자신의 것으로 만들어 이노행성의 왕이 될 수 있단 꿈에 젖어 들었다.']='Kiekvienos šalies karalius pakerėjo svajonė, kad Robertas Teiloras ir Žaibo drakonas taptų Ino valdovu.',
['그 후 왕들은 로버트 테일러와 번개고룡을 회유하기 위해 수단과 방법을 가리지 않았다.']='Vėliau karaliai nedvejodami pasitelkė įvairias priemones ir metodus, norėdami įtikinti Robertą Taylorą ir Žaibo drakonas.',
['부유하고 강한 힘을 가진 왕국은 더 강한 힘을 갖기 위해 혈안이 되었으나 힘이 없는 약소국은 그저 바라만 볼 뿐이었다.']='Turtinga ir galinga karalystė buvo apsėsta įgyti dar didesnę galią, o silpna ir bejėgė karalystė galėjo tik stebėti iš tolo.',
['로버트 테일러와 번개고룡은 그저 바라만 보던 약소국으로 향했다.']='Robertas Tayloras ir Žaibo drakonas patraukė link silpnos šalies, kurią jie stebėjo tik iš tolo.',
['이는 대국이 아닌 소국을 수호하여 희생을 막고 세상의 평화를 가져오는 것이 곧 정의라 믿었다.']='Manoma, kad tai yra teisingumas, apsaugantis ir užkertantis kelią aukoms mažose šalyse ir taikos atnešimas pasauliui, o ne galingų tautų apsauga.',
['빛과 어둠의 전쟁 이후 수천 년의 시간이 지났다.']='Tūkstančiai metų praėjo nuo karo tarp šviesos ir tamsos.',
['참혹했던 대지는 터를 잡았고 살아가는 생명의 수도 많아졌다.']='Atšiauri žemė surado savo pagrindą ir padaugėjo klestinčių gyvų būtybių.',
['빛의 결계로 인해 생명들의 삶에는 많은 변화가 일어났다.']='Dėl šviesos ryšio gyvų būtybių gyvenime įvyko daug pokyčių.',
['새로운 길이 생겨났고 이름 중심으로 시장이 생기며 크고 작은 거래가 오갔다.']='Buvo sukurtas naujas kelias, o aplink jo pavadinimą išaugo rinka, kurioje vyko dideli ir smulkūs sandoriai.',
['시장은 점점 커지며 마을을 이루었고 번성해 갔다.']='Turgus palaipsniui augo ir suformavo kaimą, klestėjusį pakeliui.',
['시간이 흘러 이름도 모를 소년에 의해 멸종된 줄 알았던 드래곤의 알이 발견된다.']='Laikui bėgant, aptinkamas drakono kiaušinis, kurį, kaip manė, išnyko nežinomas berniukas.',
['소년은 그저 큰 새의 알일 거로 생각했으나 그것은 틀림없는 드래곤의 알이었다.']='Berniukas manė, kad tai tik didelis paukščio kiaušinis, bet neabejotinai tai buvo drakono kiaušinis.',
['소문은 빠르게 퍼져나갔고 드래곤 알을 가지려는 자들은 소년을 찾기 시작했다.']='Gandas greitai pasklido ir tie, kurie norėjo turėti drakono kiaušinį, ėmė ieškoti berniuko.',
['힘에 대한 욕망에 사로잡힌 자들은 소년의 가족들을 위협하며 소년에게서 드래곤 알을 빼앗으려 했다.']='Valdžios troškimo apsėstieji grasino berniuko šeimai ir bandė atimti iš jo drakono kiaušinį.',
['위험에 처한 순간 드래곤과 함께 한 남자가 나타났다.']='Pavojaus momentu pasirodė žmogus su drakonu.',
['테일러와 번개고룡이 사라진 왕국은 쇠퇴하였고 이내 멸망에 이르게 되었다.']='Taylorą ir Žaibo drakonas praradusi karalystė žlugo ir galiausiai žuvo.',
['번개고룡은 멸망하는 왕국을 바라보았다.']='Žaibo drakonas pažvelgė į nykstančią karalystę.',
['번개고룡, 우리의 잘못된 정의가 한 왕국을 멸하였는지도 몰라...']='Žaibo drakonas, galbūt mes sunaikinome karalystę su savo klaidingu apibrėžimu...',
['희생 없는 평화를 수호하고자 하는 우리의 정의는 실현될 수 없는 걸까?']='Ar mūsų siekis sukurti taikų pasaulį be aukų yra nepasiekiamas?',
['분명 그때가 올 거야. 하지만 지금은...']='Žinoma, tas laikas ateis. Bet dabar...',
['지금은?']='Kiek dabar valandų?',
['우리의 힘을 최대한 숨겨야 해.']='Turime maksimaliai slėpti savo jėgas.',
['로버트 테일러는 전장에서 벗어나 자신의 정체를 숨긴 채 세상을 떠돌기 시작했다.']='Robertas Tayloras pradėjo klajoti po pasaulį, slėpdamas savo tapatybę ir laikydamasis atokiau nuo mūšio lauko.',
['소국의 왕은 로버트 테일러를 환대하였고 대국들은 소국을 쉽게 넘볼 수 없게 된다.']='Mažos šalies karalius pasveikino Robertą Taylorą, o didesnės tautos nebegali lengvai nepastebėti mažos šalies.',
['평화가 찾아온 듯했으나 드래곤의 힘을 탐하려는 자들이 언제든 소국에 숨어들어왔다.']='Atrodė, kad atėjo taika, bet tie, kurie ieškojo drakono galios, visada rasdavo kelią į mažą šalį.',
['평화는 길지 않았고 언제나 불안했다.']='Ramybė buvo nelengva ir visada neapibrėžta.',
['왕은 불안한 평화가 없어지려면 자신이 모든 나라를 통일시켜야 한다고 믿었다.']='Karalius tikėjo, kad norint užsitikrinti ilgalaikę taiką, reikia suvienyti visas šalis.',
['로버트 테일러와 번개고룡은 왕의 뜻이 평화를 위한 길이라 여기며 주변 왕국에 전쟁을 일으킨다.']='Robertas Teiloras ir Žaibo drakonas karaliaus akyse laiko save taikos keliais ir kursto karus aplinkinėse karalystėse.',
['전쟁은 무고한 희생이 이어졌고 이를 지켜본 번개고룡은 정의에 회의감이 들었다.']='Karas atnešė nekaltų aukų, ir tai matydamas, Žaibo drakonas baiminosi dėl teisingumo.',
['테일러, 이것이 우리가 지키고자 하는 정의인가?']='Taylor, ar tai teisingumas, kurį norime apsaugoti?',
['평화를 유지하기 위해선 희생은 피할 수 없어.']='Norint išlaikyti taiką, negalima išvengti aukų.',
['강한 힘으로 평화를 이루는 것이 아닌 희생 없이 믿음으로 평화를 이루는 게 우리의 정의야!']='Taikos siekimas stipria jėga nėra mūsų teisingumo samprata, o taikos siekimas per tikėjimą be aukos yra mūsų teisingumas!',
['그래, 맞아... 잊고 있었어, 희생 없는 평화를 바라던 우리의 정의를...']='Taip, tu teisus... Pamiršau, mūsų siekis rasti taikų sprendimą be aukų...',
['로버트 테일러와 번개고룡은 자신들의 정의를 관철시키며 모습을 감추었다.']='Robertas Tayloras ir Žaibo drakonas slėpė savo pasirodymus, laikydami savo teisingumą.',
['마이아는 검은 사도들이 방심한 틈을 타 한 빛의 사제에게 쪽지를 건네주었다.']='Maia įteikė raštelį šviesos kunigui, pasinaudojusi proga, kai juodasis apaštalas nuleido juos.',
['쪽지를 건네받은 빛의 사제는 쪽지에 적힌 로버트 테일러와 번개고룡을 찾아 나섰다.']='Šviesos kunigas, gavęs raštelį, išvyko ieškoti ant lapelio užrašyto Roberto Teiloro ir Žaibo drakonas .',
['수소문 끝에 다다른 곳은 염화의 땅이라 불리는 대륙이었다.']='Vandenilio vartų gale pasiekta vieta buvo žemynas, vadinamas Chlorido žeme.',
['빛의 사제는 번개고룡과 테일러를 찾아다녔으나 어디에도 그들의 모습은 보이지 않았다.']='Šviesos kunigas ieškojo Žaibo drakonas ir Teiloro, bet niekur nerado jų buvimo vietos.',
['떠돌던 빛의 사제 앞에 몬스터들로부터 위기에 처한 소년을 만나게 된다.']='Jis sutinka berniuką, kuriam gresia pabaisos, klaidžiojančios aplink šviesos kunigą.',
['빛의 사제는 몬스터를 물리쳐 소년을 구해주었고 소년에게 번개고룡에 대해 물어보았다.']='Šviesos kunigas nugalėjo monstrą ir išgelbėjo berniuką bei paklausė berniuko apie Žaibo drakonas.',
['소년은 고개를 끄덕이며 자신을 따라오라며 빛의 사제를 인도하였다.']='Berniukas linktelėjo galvą ir nuvedė šviesos kunigą sekti paskui save.',
['전쟁으로 인해 마음이 피폐해진 자들은 사악한 기운에 쉽게 현혹되었고, 스스로 검은 사도가 되어 힘을 갈망했다.']='Tie, kurių širdys pavargę dėl karo, buvo lengvai suvilioti piktosios jėgos, trokštantys tapti galingais juodaodžiais apaštalais.',
['신성 왕국 바이델의 빛의 사제와 그들의 수장인 마이아는 세상이 점점 어두워지는 것을 느끼기 시작했다.']='Šventosios karalystės Veidelio vadovai, šviesos kunigas ir jų vadovė Maia, pradėjo jausti, kaip pasaulis vis tamsėja.',
['마이아는 세계의 질서를 유지하고 평화를 수호하기 위한 회담을 하고자 각 왕국의 왕들에게 회담을 요청하였다.']='Maia paprašė susitikti su kiekvienos karalystės karaliais, kad išlaikytų pasaulio tvarką ir apsaugotų taiką.',
['회담 요청을 받은 왕들은 속속들이 신성 왕국 바이델로 모였고 회담이 진행되었다.']='Karaliai, gavę prašymą surengti susitikimą, vienas po kito susirinko į Šventąją karalystę Weidel ir susitikimas tęsėsi.',
['마이아의 기대와는 달리 각 왕국의 왕들은 국익을 우선시하였고, 서로의 의견을 좁히지 못하고 있을 무렵...']='Priešingai nei tikėjosi Maia, kiekvienos karalystės karaliai pirmenybę teikė savo nacionaliniams interesams ir nesugebėjo susiaurinti savo nuomonių skirtumų...',
['그러나 세상의 신질서를 만들려는 검은 사도들은 회담장으로 습격해 왔고, 빛의 사제들은 속수무책으로 당하고 만다.']='Tačiau tie, kurie siekia sukurti naują pasaulio tvarką, juodasis apaštalas užpuolė konferencijų salę, o šviesos kunigas liko bejėgis.',
['기습에 성공한 검은 사도들은 왕들과 마이아를 사로잡은 채 자신들의 뜻을 전하기 시작했다.']='Tie, kurie sėkmingai įvykdė netikėtą juodojo apaštalo ataką, pradėjo skleisti savo ketinimus, gaudydami karalius ir Maiją.',
['빛이여, 사라져라! 어둠만이 우리를 구원할지어다.']='O šviesa, dingk! Tik tamsa gali mus išgelbėti.',
['검은 사도']='Juodasis apaštalas',
['파괴가 세상을 정화하고 신세계가 도래할지니.. 새로운 세계의 주인 카데스님을 추종하라!']='Sunaikinimas apvalys pasaulį ir atsiras naujas pasaulis.. Sekite naujojo pasaulio šeimininką Kadesą!',
['번개고룡의 압도적인 힘 앞에 검은 사도들은 속수무책이었다.']='Didžiulės Žaibo drakonas galios akivaizdoje juodasis apaštalas buvo bejėgis.',
['검은 사도들은 후퇴하기 시작했고, 사로잡혔던 마이아와 왕들을 구해내었다.']='Juodasis apaštalas pradėjo trauktis, o paimta Maija ir karaliai buvo išgelbėti.',
['번개고룡의 이름은 이노행성의 여러 대륙에 퍼져나갔다.']='Žaibo drakonas pavadinimas išplito keliuose Ino žemynuose.',
['후퇴하던 검은 사도들은 번개고룡의 힘을 경험한 후 커다란 욕망에 사로잡힌다.']='Tuos, kurie traukėsi juodaodžiu apaštalu, patyrę Žaibo drakonas galią, patraukia didžiulis troškimas.',
['찾아라! 번개고룡의 알을!']='Rask tai! Žaibas drakono kiaušinis!',
['크크크, 번개고룡의 힘은 곧 우리의 손아귀에 들어올 것이다.']='Kkkk, Žaibo drakonas galia netrukus bus mūsų rankose.',
['검은 사도들은 일제히 흩어져 드래곤 알을 찾아냈고, 이내 염화의 땅에서 번개고룡의 알을 발견하게 되었다.']='Juodieji apaštalai išsiskirstė į visas puses ir galiausiai aptiko Drakono kiaušinį, o paskui aptiko Žaibas drakono kiaušinį chloravimo šalyje.',
['이 실험이 성공한다면 세상은 우리의 차지다!!']='Jei šis eksperimentas pasiseks, pasaulis bus mūsų!!',
['소년이 가리킨 곳에는 번개고룡과 로버트 테일러가 사람들과 함께 마을을 만들고 있었다.']='Berniuko nurodytoje vietoje Žaibo drakonas ir Robertas Teiloras kartu su žmonėmis kūrė kaimą.',
['테일러, 당신과 번개고룡의 힘이 필요합니다.']='Taylor, tau ir Žaibo drakonas reikia galios.',
['빛의 사제']='Šviesos kunigas',
['돌아가시오, 또다시 우리의 힘으로 희생되는 모습을 보고 싶지 않습니다.']='Prašau sugrįžti, aš nenoriu, kad tu vėl aukotum save mūsų jėgomis.',
['우리의 정의가 실현되지 않는 한 움직이지 않을 거야.']='Mes nejudėsime, kol nebus įgyvendintas mūsų teisingumas.',
['당신들의 정의란 무엇입니까?']='Koks jūsų teisingumo apibrėžimas?',
['힘으로 평화를 이루는 것이 아닌 믿음으로 평화를 이루는 것. 그게 우리의 정의야.']='Pasiekti taiką ne per jėgą, o per tikėjimą. Toks yra mūsų apibrėžimas.',
['그렇죠. 그래서 더 당신들의 힘이 필요합니다.']='Teisingai. Taigi mums reikia daugiau jūsų jėgų.',
['믿음과 신뢰로 이루어진 장소에 악의 무리들이 공격해 왔습니다.']='Grupė piktų būtybių užpuolė tikėjimu ir pasitikėjimu paremtą vietą.',
['이건 희생이 아닙니다! 세계의 질서와 평화를 수호하는 일이에요!']='Tai ne auka! Tai saugoti pasaulio tvarką ir taiką!',
['... 테일러, 우리의 정의를 실현할 때가 된 것 같아.']='...Taylor, atrodo, kad atėjo laikas mums suvokti savo teisingumą.',
['응? 뭐라고?']='Huh? Ką tu pasakei?',
['이 자의 눈에는 진실과 용기가 보여. 우리의 힘을 보여줄 때야!']='Šio žmogaus akyse matau tiesą ir drąsą. Tai kai parodome savo jėgą!',
['말도 안 돼! 어떻게 궁극의 번개고룡을...']='Tai neturi prasmės! Kaip jūs galite gauti didžiausią Žaibo drakonas...',
['위대한 힘은 믿음에서 비롯되는 것.']='Didelė jėga gimsta iš tikėjimo.',
['파괴만을 일삼는 너희들이 그걸 알 리가 없지.']='Jūs, kurie užsiimate tik destrukcija, to nežinotumėte.',
['크큭, 허나 그 힘 또한 우리는 뛰어넘을 것이다!']='Hehehe, bet mes taip pat įveiksime tą galią!',
['검은 사도는 그림자 속으로 사라지며 세상엔 다시 평화가 찾아왔다.']='Juodasis apaštalas dingo šešėlyje ir į pasaulį sugrįžo ramybė.',
