['힘을 제어할 수 있다면 더 많은 힘을 주어 희생을 막을 수 있을 것이다. 무한한 힘은 어디서 찾을 수 있단 말인가?']='Jei žmogus gali kontroliuoti savo jėgas, jis galės suteikti daugiau galios ir užkirsti kelią aukoms. Kur galima rasti begalinės jėgos, klausia jie.',
['무한의 파워드래곤은 주변에 무한의 돌을 띄운 채 파워드래곤의 공격만을 기다렸다.']='Begalinis Jėgos drakonas plūduriavo su begaliniais akmenimis, laukdamas tik Jėgos drakono puolimo.',
['파워드래곤은 무한의 힘을 거머쥔 자신에게 돌진했다.']='Jėgos drakonas puolė į save, turėdamas begalinę galią.',
['무한의 파워드래곤은 무한의 돌로 붉은 방패를 만들어 파워드래곤의 힘을 방어했다.']='Begalinės Jėgos drakonas apgynė savo galią Raudonuoju skydu, pagamintu iš begalinių akmenų.',
['그 방패를 깨트리기 위하여 파워드래곤은 백 번이고, 천 번이고 돌진했다.']='Varomas drakonas įkrovė šimtus kartų, kad sulaužytų tą skydą.',
['더 이상 포기하지도, 두려워하지도, 숨지도 않겠다!']='Aš daugiau nepasiduosiu, nebijosiu ir nesislėpsiu!',
['내 자신을 뛰어넘어 무한의 힘을 거머쥘 것이다!']='Aš pranoksiu save ir panaudosiu begalybės jėgą!',
['파워드래곤의 포효로 대지와 공기가 부서질 듯 진동했다.']='Žemė ir oras drebėjo, kai riaumoja Jėgos drakonas .',
['마지막에 온 힘을 다하여 두 주먹이 붉은 방패에 닿았을 때.']='Kai įdėjau visas jėgas ir galiausiai kumščiais atsitrenkiau į raudoną skydą.',
['방패는 단숨에 금이 가 많은 조각으로 나뉘어저 부서졌다.']='Skydas greitai buvo suskaidytas į aukso gabalus.',
['주변에 쏟아지는 붉은 방패 파편 사이에서, 무한의 파워드래곤은 말했다.']='Tarp išsibarsčiusių raudonų skydų fragmentų aplink mane pasakė Begalinės Jėgos drakonas .',
['\"너는 이미 무한의 힘을 손에 쥐었다.\"']='Jūs jau turite begalybės galią savo rankose.',
['파워드래곤의 모습은, 자신이 마주한 그 모습과 똑같은 모습이 되어 있었다.']='„Jėgos drakonas“ išvaizda buvo lygiai tokia pati, kaip ir prieš ją.',
['무한의 힘이 넘치는 자신의 모습 속에서 파워드래곤은 오히려 진정되었다.']='Išvaizdos, perpildytos begalinės galios, viduryje Jėgos drakonas tapo dar labiau susikaupęs.',
['더는 피하지도, 숨길 필요도 없었다.']='Nebereikėjo to vengti ar slėpti.',
['무한의 힘을 지닌 무한의 파워드래곤.']='Begalinės Jėgos drakonas, turintis begalinę galią.',
['무한의 파워드래곤은 파워드래곤의 앞에 엄청난 자태를 뽐내며 서 있었다.']='Begalinis Jėgos drakonas stovėjo priešais Jėgos drakonas ir demonstravo savo didžiulį ūgį.',
['이것이 진정한 힘을 이끌어낸 나의 모습이란 말인가?']='Ar tai reiškia, kad tai yra mano tikroji forma, kuri išryškina tikrąją galią?',
['자신을 넘어서라. 자신을 넘어 두려움을 이겨낸 자만이 무한의 힘을 이끌어낼 수 있을 것이다.']='Peržengti save. Tik tie, kurie įveikia savo baimes, gali atskleisti begalinę galią.',
['파워드래곤은 무고한 생명들에게만 힘을 분배하며 몬스터들을 물리쳐 나아갔다.']='Jėgos drakonas paskirstė galią tik nekaltoms būtybėms ir nugalėjo monstrus judėdamas į priekį.',
['자신의 힘을 받은 몬스터들이 만행을 저지른 것에 대한 자책감을 느꼈고,']='Jaučiasi kaltas dėl savo jėgomis varomų monstrų padarytų nusižengimų,',
['파워드래곤의 능력은 자신도 모르는 사이 주변의 생명들에게 자신의 힘을 불어넣어 주는 것이었다.']='Jėgos drakonas galia buvo nesąmoningai įlieti savo jėgų jį supančioms gyvoms būtybėms.',
['그로 인해 파워드래곤의 힘을 받은 주변의 생명들은 활력이 넘쳐났다.']='Dėl to aplinkiniai tvariniai, turintys drakono galios, buvo kupini gyvybingumo.',
['탐욕에 가득 찬 몬스터들은 파워드래곤의 능력으로 자신의 힘을 강화하는 것에 혈안이 되어 갔다.']='Godūs monstrai tapo apsėsti stiprinti savo jėgą, naudodami Jėgos drakonas sugebėjimus.',
['힘을 제어할 수 있다면 더 많은 힘을 주어 희생을 막을 수 있을 것이다.']='Jei galite kontroliuoti savo jėgas, galite suteikti daugiau jėgų ir užkirsti kelią aukoms.',
['무한한 힘은 어디서 찾을 수 있단 말인가?']='Kur galima rasti begalinės jėgos?'}